// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {IUniswapV3SwapRouter} from "./interfaces/IUniswapV3SwapRouter.sol";
import {IDexHandler} from "./interfaces/IDexHandler.sol";

abstract contract UniswapV3Handler is IUniswapV3SwapRouter, IDexHandler {
    function executeSwap(bytes calldata data) external returns (uint256 amountOut) {
        (address router, bytes memory dataSend) = abi.decode(data, (address, bytes));
        (
            address tokenIn, 
            address tokenOut,
            uint24 fee,
            address recipient,
            uint256 deadline,
            uint256 amountIn,
            uint256 amountOutMinimum,
            uint160 sqrtPriceLimitX96
        ) = 
            abi.decode(dataSend, (address, address, uint24, address, uint256, uint256, uint256, uint160));
        ExactInputSingleParams memory param = ExactInputSingleParams({
            tokenIn: tokenIn,
            tokenOut: tokenOut,
            fee: fee,
            recipient: recipient,
            deadline: deadline,
            amountIn: amountIn,
            amountOutMinimum: amountOutMinimum,
            sqrtPriceLimitX96: sqrtPriceLimitX96
        });

        amountOut = IUniswapV3SwapRouter(router).exactInputSingle(param);
    }
}

